import React, { useState } from 'react';
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';

const TokenEntry = (props) => {

    const [addr, setAddr] = useState('');

    const handleSubmit = (event) => {
        event.preventDefault();
        props.submit(addr);
    }

    return (
        <Form onSubmit={handleSubmit}>
            <div className="form-row"><label>Token Address</label><input type="text" value={addr} className="text-input" onChange={(event)=>setAddr(event.target.value)}/></div>
            <div className="form-row btn-row"><Button variant="primary" onClick={handleSubmit}>Get Token</Button></div>
        </Form>
    )
}

export default TokenEntry;
